import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';
import './Wallet.css';

const Wallet = () => {
  const { user } = useAuth();
  const [creditBalance, setCreditBalance] = useState(0);
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchCreditWallet();
    fetchTransactions();
  }, []);

  const fetchCreditWallet = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get('/api/v1/wallet/credit', {
        headers: { Authorization: `Bearer ${token}` }
      });
      if (res.data.status === 'success') {
        setCreditBalance(res.data.balance || 0);
      }
    } catch (error) {
      console.error('Failed to fetch credit wallet:', error);
      setError('Failed to fetch wallet data');
    }
  };

  const fetchTransactions = async () => {
    try {
      const token = localStorage.getItem('token');
      const res = await axios.get('/api/v1/transactions', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTransactions(res.data.data || []);
      setLoading(false);
    } catch (error) {
      console.error('Failed to fetch transactions:', error);
      setLoading(false);
    }
  };

  const getWalletIcon = (type) => {
    switch (type) {
      case 'bonus':
        return 'ðŸŽ';
      case 'passive':
        return 'ðŸ’°';
      default:
        return 'ðŸ‘›';
    }
  };

  const getWalletColor = (type) => {
    switch (type) {
      case 'bonus':
        return 'bonus';
      case 'passive':
        return 'passive';
      default:
        return 'default';
    }
  };

  if (loading) {
    return <div className="loading">Loading wallet data...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="wallet-container">
      <div className="wallet-header">
        <h1>My Wallets</h1>
        <p>Manage your different wallet types and balances</p>
      </div>

      <div className="wallets-grid">
        {wallets.map((wallet) => (
          <div key={wallet._id} className={`wallet-card ${getWalletColor(wallet?.walletType)}`}>
            <div className="wallet-icon">
              {getWalletIcon(wallet?.walletType)}
            </div>

            <div className="wallet-info">
              <h3>{wallet?.walletType ? wallet.walletType.charAt(0).toUpperCase() + wallet.walletType.slice(1) : "Unknown"} Wallet</h3>
              <div className="wallet-balance">
                <span className="currency">â‚±</span>
                <span className="amount">{wallet?.balance?.toLocaleString() || '0'}</span>
              </div>
            </div>

            <div className="wallet-actions">
              <button className="btn btn-sm btn-outline">
                View Transactions
              </button>
            </div>
          </div>
        ))}
      </div>

      {wallets.length === 0 && (
        <div className="no-wallets">
          <p>No wallets found. Wallets will be created automatically when you make your first transaction.</p>
        </div>
      )}

      <div className="wallet-info-section">
        <h2>Wallet Information</h2>
        <div className="info-grid">
          <div className="info-card">
            <h4>ðŸ’° Cash Wallet</h4>
            <p>Your main wallet for deposits and withdrawals. Use this wallet to fund your investments.</p>
          </div>

          <div className="info-card">
            <h4>ðŸ“ˆ Investment Wallet</h4>
            <p>Tracks your active investment amounts. Funds are automatically moved here when you create investments.</p>
          </div>

          <div className="info-card">
            <h4>ðŸ’Ž Earnings Wallet</h4>
            <p>Receives your investment returns and profits. You can withdraw earnings or reinvest them.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Wallet;
